import React from 'react';

function CarList({ cars }) {
  // Verifique se 'cars' é um array antes de chamar 'map'
  if (!Array.isArray(cars)) {
    return <div>Erro: 'cars' não é um array.</div>;
  }

  return (
    <div>
      <h2>Lista de Carros</h2>
      <ul>
        {cars.map((car, index) => (
          <li key={index}>
            {car.name} - {car.brand} - {car.year} - {car.color}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default CarList;
